huge\",\"swollen\",\"belly\",\"tummy\",\"fat\",\"young\",\"girl\",\"women\",\"born\",\"birth\",\"labour\"],\"channelId\":\"UCWQVkb20Cf51A8Qvopjnssg\",\"isOwnerViewing\":false,\"shortDescription\":\"Part 1 of a 2 part documentary\\n\\nHaving a baby in prison is no picnic. Every year thousands of babies are born in American prisons. Many of them are taken away from their mothers at birth or soon after. These powerful, moving, shocking and insightful films follow the dramatic and emotional stories of a group of pregnant inmates at the Indiana Womens Prison. Featuring births, babies and a lot of tears this film uses powerful personal stories to pose poignant questions about how the criminal justice deals with women and children. Challenging preconceptions they make the viewer see prisoners in a new light as mothers and human beings. Can the bond between mother and child survive the harsh realities of life behind bars?\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/nErmW89_hr0\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLARXbZwWxPIW8HpyRRyKhc0rSaYtw\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/nErmW89_hr0\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLDjGV3XI6ByxAwapxmI8Uw9ymmFzw\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/nErmW89_hr0\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLD6ho_htigkOrJbWqMra2MWLYagmQ\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/nErmW89_hr0\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLCxwiOzRcjbE8Ai1uwDy5-Sct4KIg\",\"width\":336,\"height\":188}]},\"averageRating\":4.6678829,\"allowRatings\":true,\"viewCount\":\"8544692\",\"author\":\"Swollen Bellies\",\"isPrivate\":false,\"isUnpluggedCorpus\":false,\"isLiveContent\":false},\"playerConfig\":{\"audioConf
